-- ----------------------------
-- Table structure for cmf_domain
-- ----------------------------
DROP TABLE IF EXISTS `cmf_domain`;
CREATE TABLE `cmf_domain`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `domain` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '域名',
  `title` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '网站名',
  `logo` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'logo地址',
  `more` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '更多参数',
  `is_true` tinyint(4) NOT NULL DEFAULT 1 COMMENT '是否可以访问',
  `uid` int(11) NOT NULL DEFAULT 0 COMMENT '管理员账号id（管理员账号主站代理站通用）',
  `qq_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `wechat_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_download
-- ----------------------------
DROP TABLE IF EXISTS `cmf_download`;
CREATE TABLE `cmf_download`  (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `coin` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '金额',
  `download` int(11) NULL DEFAULT NULL COMMENT '购买下载次数',
  `gift` int(11) NULL DEFAULT NULL COMMENT '购买赠送下载次数：大于0有效',
  `recommend` smallint(2) NULL DEFAULT NULL COMMENT '推荐购买状态：0-不推荐；1-推荐',
  `status` smallint(2) NULL DEFAULT NULL COMMENT '下载购买状态：0-不显示；1-显示',
  `addtime` int(11) NULL DEFAULT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for cmf_downloading
-- ----------------------------
DROP TABLE IF EXISTS `cmf_downloading`;
CREATE TABLE `cmf_downloading`  (
  `id` int(32) NOT NULL AUTO_INCREMENT,
  `appid` int(255) NULL DEFAULT NULL,
  `addtime` int(32) NULL DEFAULT NULL COMMENT '时间',
  `num` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '正在下载表' ROW_FORMAT = Compact;

